import React, { Component } from "react";
import axios from "axios";
import moment from "moment";
import "../styles/style.css";

export default function DisplayOrders(props) {
  const [listData1, setListData1] = React.useState([]);

  React.useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios
      .get("https://my.api.mockaroo.com/orders.json?key=e49e6840")
      .then((response) => {
        setListData1(response.data);
        console.log(">>>>>>>>>>>>>", listData1);
      });
  };

  const getDetails = (item) => {
    props.history.push({
      pathname: "/OrderDetails",
      state: item,
    });
  };

  return (
    <div>
      <div class="data">
        <h1>Package Viewer Express</h1>
        <p></p>
        <label class="heading">ðŸ“¦ Package Details</label>
      </div>
      <table id="customers">
        <tr>
          <th>Serial Number</th>
          <th>Sender Name</th>
          <th>Arrived date</th>
          <th>View details </th>
        </tr>
        {listData1 !== undefined && listData1.length > 0
          ? listData1.map((item, index) => (
              <tr>
                <td>{index}</td>
                <td>{item.sender}</td>
                <td>{moment(item.last_updated).format("MM/DD/YYYY")}</td>
                <td>
                  <button onClick={() => getDetails(item)}>
                    {" "}
                    View Details
                  </button>
                </td>
              </tr>
            ))
          : []}
      </table>
    </div>
  );
}
